webpackJsonp([86686928953004],{3090:function(e,a){e.exports={data:{talkJson:{description:'HTML5 Boilerplate is a "rock-solid defualt for HTML5 awesome." In this video, Paul Irish, the man behind the project will show you how you can use HTML5 Boilerplate to get your projects up and running quickly while keeping best practices covered.\n\nPaul will start with an overview of HTML5 Boilerplate before diving into some examples and demos to give you a feel for how you can jumpstart your next project with HTML5 Boilerplate.\n\n** Head over to http://marakana.com to learn more about HTML5 and open source development **',meta:{duration:"PT1H4M20S"},presenter:{name:null},slug:"paul-irish-on-html5-boilerplate",source:{id:"qyM37XKkmKQ",provider:"youtube"},tag:["HTML5","Development","Paul","Irish","Boilerplate","open","source","tutorial","Marakana","example","techtv","San","Francsico","User","Group"],title:"Paul Irish on HTML5 Boilerplate"},allTalkJson:{edges:[{node:{description:'"Linux Sucks".  2014 edition.  Recorded live at LinuxFest Northwest on April 26th, 2014.\n\nHow to yell at me:\nBlog: http://www.lunduke.com\nTwitter: http://twitter.com/BryanLunduke\nG+: https://plus.google.com/+BryanLunduke',meta:{duration:"PT44M59S"},presenter:{name:null},source:{id:"5pOxlazS3zs",provider:"youtube"},slug:"linux-sucks-2014",tag:["linux","sucks","lunduke","open","source","GNU/Linux","(Operating","System)"],thumbnails:{default:{url:"https://i.ytimg.com/vi/5pOxlazS3zs/default.jpg",height:90,width:120}},title:'"Linux Sucks" - 2014'}},{node:{description:'Anthony Bull believes that all MVC frameworks make trade-offs, but that Ember.js provides the best balance for developing well-factored and ambitious web applications. This talk at the SF HTML5 User Group meetup on January 31st, 2013, features:\n \n-an introduction to ember.js\n-comparisons to other frameworks\n-code to demonstrate the ember.js syntax.\n \nFind out why Anthony calls ember.js the "swiss-army-knife" of developing frameworks.\n\n**Interested in a closer look at Anthony\'s slides? Check them out here: http://mrkn.co/enaa6',meta:{duration:"PT28M39S"},presenter:{name:null},source:{id:"9a0OP4in-ac",provider:"youtube"},slug:"snappy-performance-apps-with-emberjs",tag:["HTML5","SFHTML5","Anthony Bull","ember.js","applications","crowdflower","TechTv","performance"],thumbnails:{default:{url:"https://i.ytimg.com/vi/9a0OP4in-ac/default.jpg",height:90,width:120}},title:"Snappy Performance Apps with Ember.js"}},{node:{description:"New web developers have trouble distinguishing jQuery from JavaScript. We frequently point developers to three.js for doing 3D on the web, but what is raw WebGL and what tools do we have for debugging 3D web applications?",meta:{duration:"PT55M21S"},presenter:{name:"Nick Desaulniers"},source:{id:"H4c8t6myAWU",provider:"youtube"},slug:"mozilla-raw-webgl",tag:["HTML5","HTML5DevConf 2014","JavaScript","Node.js","Web Browser"],thumbnails:{default:{url:"https://i.ytimg.com/vi/H4c8t6myAWU/default.jpg",height:90,width:120}},title:"Mozilla Raw WebGL"}},{node:{description:"In this video tutorial, Dan Rosen will show you how to use Scala's capacity for monadic design to eliminate repetitive boilerplate in your code.  You'll learn to recognize places where the perpetual clutter of null checks, try-catch blocks and more can be hidden within a monad, to make your code's logic stand out clearly.\r\n\r\n** Head to http://marakana.com for more open source educational resources",meta:{duration:"PT31M22S"},presenter:{name:null},source:{id:"Mw_Jnn_Y5iA",provider:"youtube"},slug:"scala-monads-declutter-your-code-with-monadic-design",tag:["scala","monad","monadic","design patterns","monadic design","dan rosen","marakana","techtv","Code","Demo"],thumbnails:{default:{url:"https://i.ytimg.com/vi/Mw_Jnn_Y5iA/default.jpg",height:90,width:120}},title:"Scala Monads: Declutter Your Code With Monadic Design"}},{node:{description:"Java is no longer alone on the JVM. It now has to share space with its younger siblings JRuby, Jython, Groovy, Clojure, Scala and many others. Each new language has its own set of advantages and disadvantages compared to Java, and its own niche in which it performs best, but Scala in particular is gaining momentum.\n\nIn this presentation to San Francisco Java User Group on January 18, 2012, Marakana's own Dan Rosen introduces Scala to Java developers and shows off some of its expressive power -- higher-order functions, type inference, and pattern matching -- by building a simple web service. You'll never look at Java the same way.\n\nSlides from this presentation available here http://bit.ly/ztgVxa",meta:{duration:"PT1H32M35S"},presenter:{name:null},source:{id:"PKc5IwHG68k",provider:"youtube"},slug:"scala-versus-java",tag:["scala","java","marakana","techtv","typesafe","dan rosen","sbt","jdk"],thumbnails:{default:{url:"https://i.ytimg.com/vi/PKc5IwHG68k/default.jpg",height:90,width:120}},title:"Scala Versus Java"}},{node:{description:"David Beazley\nWhat's more fun than learning Python? Learning Python by hacking on public data! In this tutorial, you'll learn Python basics by reading files, scraping the web, building data structures, and analyzing real world data. By the end, you w",meta:{duration:"PT2H38M22S"},presenter:{name:null},source:{id:"RrPZza_vZ3w",provider:"youtube"},slug:"learn-python-through-public-data-hacking",tag:["psf","pycon2013","tutorial","DavidBeazley"],thumbnails:{default:{url:"https://i.ytimg.com/vi/RrPZza_vZ3w/default.jpg",height:90,width:120}},title:"Learn Python Through Public Data Hacking"}},{node:{description:"Joshua Bloch serves up a few Java Puzzlers as an appetizer before and as dessert after the main course on Effective Java.\r\n\r\nOrganized By: Silicon Valley Web JUG - Van Riper and Kevin Nilson\r\nHosted and Sponsored By: Google\r\nVideo By: Marakana\r\n\r\nEvent: http://www.meetup.com/sv-web-jug/calendar/10878461/\r\n\r\nSlides: http://files.meetup.com/1381525/still-effective.ppt.pdf",meta:{duration:"PT1H13M59S"},presenter:{name:null},source:{id:"V1vQf4qyMXg",provider:"youtube"},slug:"effective-java-still-effective-after-all-these-years",tag:["Joshua","Bloch","Effective","Java","Puzzlers","Silicon","Valley","Web","User","Group","JUG","Van","Riper","Kevin","Nilson","Marakana"],thumbnails:{default:{url:"https://i.ytimg.com/vi/V1vQf4qyMXg/default.jpg",height:90,width:120}},title:"Effective Java - Still Effective After All These Years"}},{node:{description:"Blake Matheny approaches his talk at NEScala with a collection of trial-and-error experiences he's acquired as the VP of Engineering at Tumblr (who for the past year and half has adopted Scala as their primary backend development language). Blake draws on actual code used at Tumblr, describes their implications in a server context, and shows us where things have gone wrong and how they were corrected.\n \nThis talk will be most pertinent to engineers who build backend service applications, but should be of interest to anyone looking to find additional methods for troubleshooting code in Scala.\n\n** Visit our site for more content on Scala, including the rest of the presentations from NE Scala 2013: http://marakana.com/s/tags/scala",meta:{duration:"PT29M53S"},presenter:{name:null},source:{id:"dCEZDlH1ygo",provider:"youtube"},slug:"concurrency-anti-patterns-in-scala",tag:["scala","blake matheny","tumblr","nescala","marakana","techtv"],thumbnails:{default:{url:"https://i.ytimg.com/vi/dCEZDlH1ygo/default.jpg",height:90,width:120}},title:"Concurrency Anti-patterns in Scala"}},{node:{description:'In my technical presentation ("The Evolution of Java: Past, Present, and Future"), I\'ll be discussing all of the changes to the Java programming language since its inception. In this this keynote, I\'ll focus my attention on the starting point: I\'ll present my candidates for the best and worst features in the platform as it was originally released (JDK 1.0), and explain the reasoning behind my choices. Some of my choices may be obvious, but others will likely surprise you. A splendid time is guaranteed for all.\n\nJosh Bloch\n\nGoogle\n\nJoshua Bloch is a software architect in the Open Source Program Office at Google, author of the bestselling, Jolt Award-winning "Effective Java" (Addison-Wesley, 2001; Second Edition, 2008), and coauthor of "Java Puzzlers: Traps, Pitfalls, and Corner Cases" (Addison-Wesley, 2005) and "Java Conurrency in Practice" (Addison-Wesley, 2006). He was previously a Distinguished Engineer at Sun Microsystems, where he led the design and implementation of numerous Java platform features including the Java Collections Framework and JDK 5.0 language enhancements. He holds a Ph.D. from CMU and a B.S. from Columbia.',meta:{duration:"PT14M34S"},presenter:{name:null},source:{id:"hcY8cYfAEwU",provider:"youtube"},slug:"oscon-java-2011-josh-bloch-java-the-good-bad-and-ugly-parts",tag:["oreilly","oreillymedia","oscon","opensource","java","data","perl","HTML5","android","mobile","conference","convention","O'Reilly","Tim O'Reilly","O'Reilly Media","OReilly","Tim OReilly","OReilly Media","OReillyMedia","o'reilly","books"],thumbnails:{default:{url:"https://i.ytimg.com/vi/hcY8cYfAEwU/default.jpg",height:90,width:120}},title:'OSCON Java 2011:  Josh Bloch, "Java: The Good, Bad, and Ugly Parts"'}},{node:{description:'Callback Hell is a very real place. At least, according to Michael Jackson, co-founder of HUM, it is. But stay calm! In this presentation, Michael and his co-presenter\nDomenic Denicola, Software Engineer at Lab49, will walk you through all the steps required to avoid this dark and mysterious place.\n\nInstead of simply throwing together a clunky example, and a solution to a very specific case, Michael and Domenic dive deeper into more conceptual problems. How did we get to "callback hell" and what can we do it avoid it next time? This helpful demonstration covers handy tips about Promises and strategies for building fully asynchronous APIs in JavaScript.\n\n**Follow along with Michael and Domenic\'s slides: http://mrkn.co/lb0t1',meta:{duration:"PT50M25S"},presenter:{name:null},source:{id:"hf1T_AONQJU",provider:"youtube"},slug:"redemption-from-callback-hell",tag:["callback","callback hell","marakana","techtv","html5","html5devconf","michael jackson","michael jackson develoepr","domenic denicola","HUM","Lab49"],thumbnails:{default:{url:"https://i.ytimg.com/vi/hf1T_AONQJU/default.jpg",height:90,width:120}},title:"Redemption from Callback Hell"}}]}},pathContext:{slug:"paul-irish-on-html5-boilerplate",tags:["HTML5","Development","Paul","Irish","Boilerplate","open","source","tutorial","Marakana","example","techtv","San","Francsico","User","Group"]}}}});
